          <div class="cent">
            <img src="../assets/img/zhanghao@2x.png" alt>
            <span>账号：</span>
          </div>
          <input type="text" v-model="user.username">
        </div>
        <div>
          <div class="cent cent2">
            <img src="../assets/img/mima@2x.png" alt>
            <span>密码：</span>
          </div>
          <input type="text" v-model="user.password">
        </div>
        <!-- <div><div class="cent"><img src="../assets/img/mima@2x.png" alt=""><span></span><input type="text"></div> -->
      </div>
      <div class="btn">
        <button @click="ok()">登陆</button>
